import React from 'react'

export const ChatWindow = (allMessages) => {

  if (!allMessages) {
    return (
      <div> No any messages yet </div> )
  }

  return (
    <>  <div>
          { allMessages.map( (message, index) => {
            return (
              <div>
                {message.text}
              </div>
            )
          } ) }
        </div>
    </>
  )
}
